  "in_reply_to_user_id" : 3119862113,
  "text" : "When #JINHWAN ends the song, though the lyrics are similar, it provides a different feel. In contrast to the uncertain promises at the beginning of the song, this time around, the lyrics were portrayed with determination. It almost feel like that the singer himself now believes -",
