  "id_str" : "1013867097489731585",
  "in_reply_to_user_id" : 3119862113,
  "text" : "the words he is singing. It is no longer a casual promise. It now becomes a commitment. That emotional development within the song was supported by an equally moving bgm. It's so beautiful, it gave me the chills. #FORYOU is my fave fansong to date.",
  "id" : 1013867097489731585,
