  "in_reply_to_user_id" : 3119862113,
  "text" : "At #YUNHYEONG's part, the vibe becomes more positive. His voice perfectly reflects the line 'you're my light in this never-ending darkness.' This is because his clear vocal tone was sustained the entire time. It isn't airy or raspy. It's literally like a light that floats around.",
