  "geo" : { },
  "id_str" : "1013867088878788608",
  "in_reply_to_user_id" : 3119862113,
  "text" : "I love #HANBIN's vocals. I love that he didn't rap. I'm so tired of emotional songs in kpop where they add raps that doesn't fit in the song at all. Adding an unneeded ingredient can break the recipe. Hanbin chose to stay true to the song and sang. And he did it good.",
