  "geo" : { },
  "id_str" : "1013867090380349444",
  "in_reply_to_user_id" : 3119862113,
  "text" : "The way #HANBIN sang isn't pretentious. It's almost as if he's talking. But the way he hits high notes is almost like a caress that gently fades out. His voice has a certain fondness in it. If #June sang this part with stubborn promises, Hanbin sang his w\/ dedicated perseverance.",
