  "geo" : { },
  "id_str" : "1013867083413667840",
  "in_reply_to_user_id" : 3119862113,
  "text" : "When #JUNHOE enters, the bgm was stripped back to nothing but the guitar at the forefront. With his soft full vocal, he fills your ears with promises. And you believe it because his adamant sincerity comes from nothing but his voice alone. No distractions.",
