  "in_reply_to_user_id" : 3119862113,
  "text" : "When #DONGHYUK enters with his falsetto, I thank all that is holy that he now embraces his voice. Donghyuk's voice is like a hug. When he sustains a note, it's so pitch perfect that at some point in his part, his voice could pass as the strings in the bgm. \uD83D\uDE2D\uD83D\uDE2D\uD83D\uDE2D",
