  "id_str" : "1013867086135738368",
  "in_reply_to_user_id" : 3119862113,
  "text" : "When #JINHWAN enters, the beats at the beginning of the song were used again. Which is effective because it brings you back to the vibe initially proposed in the song; the feelings of regret for promises not kept can be felt in Jinani's intonation and enunciation.",
  "id" : 1013867086135738368,
