  "id_str" : "1013867079215091712",
  "in_reply_to_user_id" : 3119862113,
  "text" : "I'm in love with the guitar in this song. It's an influential presence that makes you feel at ease. In contrast, the beats at the beginning entices you to listen. It strikes curiosity. But when the guitar comes in along with #JUNHOE's voice, it hits you emotionally.",
