  "text" : "The line allocation is spot on. The lyrical context matches the vocal tones of the singers in each line. #BOBBY's vocal tone have always had a feel of desperation &amp; regret. His raspy voice was utilized to convey the feeling of wanting to do better for someone but not having-",
